import Game from "./pages/Game";
import {Route} from "react-router-dom";

export default function App(){

  const Index  = () => {
    return (
        <>
          <h2>Hello React</h2>
        </>
    )
  }

  return (
      <Route>
        <Route path="/" element={<Index/>}/>
        <Route path="/game" element={<Game/>}/>
      </Route>
  )
}
